import React from 'react';
import logo from './logo.svg';
import './App.css';
import './project_preview.css';
import ProjectPreview from "./ProjectPreview"

function App() {
  return (
    <div className="app">


      <div className="landing-page">
        <header className="app-header">
          <p className="nav-header">Welcome</p>
          <div className="header_title">
            <p className="header1">I'm Cathleen, designer-developer.</p>
            <p className="header2">I believe in creating beautifully engineered products to empower others.</p>
          </div>
        </header>

        <div className="projects">
          <ProjectPreview name="Uber" description="Product design" imgUrl={require("./assets/uber-preview.png")} side="project_preview_left"/>
          <ProjectPreview name="Uber" description="Product design" imgUrl={require("./assets/uber-preview.png")} side="project_preview_right"/>

        </div>

      </div>


      <div className="side-nav">
        <div className="navbar">
          <div className="navbar-01"/>
          <div className="navbar-02"/>
        </div>
        <p className="nav-email">cathleenjia@berkeley.edu</p>
      </div>


    </div>
  );
}

export default App;
